import React from 'react';

class BandCard extends React.Component {

  render() {

    const imagePath = this.props.imagePath;
    const bandName = this.props.bandName;
    const numStans = this.props.numStans;

    return (
      <div>
        <div class="ui card">
          <a class="image" href="#">
            <img src={imagePath} />
          </a>
          <div class="content">
            <a class="header">{bandName}</a>
            <div class="meta">
              <a>{numStans} Stans</a>
            </div>
          </div>
        </div>
      </div>
    );
  }

}

export default BandCard;
